import React from 'react';
import './composemail.css';

export default function ComposeMail() {

    return (
        <div className='compose-mail'>
            <div className='recipient-container'>
                <input id="recipientInp" type='text' name='recipients' placeholder='Recipients' />
            </div>
            <div className='subject-container'>
                <input id="subjectInp" type='text' name='subject' placeholder='Subject' />
            </div>
            <div className='message-container'>
                <textarea id="messageInp" name='message' placeholder='Type Something here..' />
            </div>
            <div className='footer'>
                <button id="sendMailBtn" onClick={() => alert('Mail Sent')}>Send</button>
            </div>
        </div>
    );
}
